import React from "react";
import BabyNamesData from "./BabyNamesData.json";

const Names = (props) => {
  const sortNames = BabyNamesData.sort((a, b) => a.name > b.name);
  // console.log(sortNames);

  return (
    <div>
      <ul>
        {sortNames.map((x, i) => {
          return (
            <li key={i}>
              {/* {console.log(x.name)} */}
              {x.name}
            </li>
          );
        })}
      </ul>
    </div>
  );
};
export default Names;
